const CardItemList = (props) => (
    <li className="list-group-item d-flex justify-content-between align-items-center">
        Cras justo odio {props.clienteID}
    <div className="ml-3">
        <span className="badge badge-success badge-pill mx-1">Aceptar</span>
        <span className="badge badge-danger badge-pill mx-1">Rechazar</span>
        <span className="badge badge-primary badge-pill">Archivar</span>
    </div>
  </li>
);

export default CardItemList;
